ull solve () {
	sll i, j, ki, li;
	// ull result = 0;
	sll result = 0;
	double dresult = 0;
	// ull maybe = 0;
	sll maybe = 0;
	// ull sum = 0;
	sll sum = 0;
	sll item;
	ull *dpcell;

	ull gaps[2];
	gaps[0] = vua;
	gaps[1] = vub;

	for (j = 0; j < 2; j++) {
		ki = 0;
		for (i = 0; i < n; i++) {
			if (i && a[i] - a[i - 1] < gaps[j]) ki = i;
			x[i][j] = ki;
		}
	}
	for (j = 0; j < 2; j++) {
		ki = -1;
		for (i = 0; i < n; i++) {
			while (a[i] - a[ki + 1] >= gaps[j]) ki++;
			y[i][j] = ki;
		}
		y[n][j] = n - 1;
	}

	dp[0][0] = dp[0][1] = 1;
	dpsum[0][0] = dpsum[0][1] = 1;
	for (i = 0; i < n; i++) {
		for (j = 0; j < 2; j++) {
			sll lower = x[i][j] - 1;
			sll upper = smin(i - 1, y[i + 1][j ^ 1]);

			if (lower > upper) {
				dp[i + 1][j] = 0;
			} else {
				dp[i + 1][j] = (MOD + dpsum[upper + 1][j ^ 1] - (lower >= 0 ? dpsum[lower][j ^ 1] : 0)) % MOD;
			}
			// printf("%llu ", dp[i + 1][j]);

			dpsum[i + 1][j] = (dpsum[i][j] + dp[i + 1][j]) % MOD;
		}
		// puts("");
	}

	result = (dp[n][0] + dp[n][1]) % MOD;

	printf("%lld\n", result);
	// printf("%.12lf\n", dresult);
	// puts(s);

	return 0;

